import React from 'react';

const UserBox = (id, nombre, apellido, comuna) =>{

    return(
        <div className="br2 ba dark-gray b--black-10 mv4 w-100 w-50-m w-25-l mw5 center">
            <div>
                <h4>id: {id}</h4>
            </div>
            <div>
                <h4>Nombre: {nombre}</h4>
            </div>
            <div>
                <h4>Apellido: {apellido}</h4>
            </div>
            <div>
                <h4>Comuna: {comuna} </h4>
            </div>
        </div>
    )
}

export default UserBox;
